2.jpg','none','http://www.youtube.com/watch?v=W50L7eNGT2U','none','',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none','','xhtml','Watch Video','none','','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(6,1,7,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}CAROUSEL-Celebrity_Film-thumb.jpg','none','Watch','none','Celebrity Support ','none','{filedir_1}CAROUSEL-Celebrity_Film-panel.jpg','none','http://www.youtube.com/watch?v=03KTq85Y3wM','none','','none','','none','<p>Starkey Hearing Foundation is fortunate to have hundreds of high-profile friends to help us raise awareness and generate support, and for many, their commitment also extends into the mission field.</p>\n\n<p>Watch as our celebrity ambassadors explain why they support the gift of hearing.&nbsp;</p>','none','',NULL,'',NULL,'',NULL,'',NULL,'','none','','xhtml','','none','','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(7,1,7,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}CAROUSEL-Listen_Carefully.jpg','none','Watch Now','none','Listen Carefully Goes Live','none','{filedir_1}CAROUSEL-Listen_Carefully.jpg','none','http://www.youtube.com/watch?v=rlyH-ZcCf7o','none','Learn More','none','/programs#/programs/1','none','<p>Disney and Nickelodeon stars Chris and Kyle Massey join Grammy Award-winning songwriter/producer Dallas Austin to educate a crowd of more than 1,400 at our launch event. The music and sound experience inspired not only a dance contest but also sent the right message: <em>Hearing is fragile. Listen Carefully.&nbsp;</em></p>\n\n<p>Watch all the highlights.&nbsp;</p>','none','',NULL,'',NULL,'',NULL,'',NULL,'','none','','xhtml','','none','','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(8,1,7,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}CAROUSEL-Hear_Now-Hearing_Aid_Recycling_Program.jpg','none','Watch Now','none','Recycling Sound','none','{filedir_1}CAROUSEL-Hear_Now-Hearing_Aid_Recycling_Program.jpg','none','http://www.youtube.com/watch?v=tF-9R4UUWa8','none','Learn More ','none','/programs#/programs/3','none','<p>Every year thousands of used hearing aids are donated to our Hear Now program people looking to help. Those hearing aids open up the world of sound to someone in need. Many of the hearing aids used on international missions come from the recycling program, making hearing aid donations vital to the success of the Starkey Hearing Foundation.</p>\n\n<p>Watch as we take you through the recycling process.&nbsp;</p>','none','',NULL,'',NULL,'',NULL,'',NULL,'','none','','xhtml','','none','','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(9,1,6,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'Where We Are Now ','none','{filedir_1}icon_now.png','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none','','xhtml','','none','','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(10,1,3,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','28.6','none','77.2','none','India ','none','<p>The mission team is excited to be back in India working with our Starkey India team to give the gift of hearing across four cities.</p>','none','',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none','','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}MAP-Where_We_Are_Now-India-DSC03269cc.jpg','none','','xhtml','','none','','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(11,1,2,'',NULL,'',NULL,'',NULL,' ','xhtml',NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'Hearing Mission Statement Here. ','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','','none','','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(13,1,5,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'true','none','{filedir_1}Blog_Philippines_.jpg','none','Hearing Missions','none',1387524240,'','none','<p><b>Caring for Our Friends in the Philippines</b></p>\n\n<p>&nbsp; Over 35 days, four countries and 10 cities, the hearing mission team finished the year strong, fitting more than 12,000 people. Crisscrossing Asia, we brought the gift of hearing to India, Cambodia, China and completed our tour with an impactful, four-city hearing mission in the Philippines.</p>\n\n<p>&nbsp; </p>\n\n<p>&nbsp; Typhoon Haiyan struck the Philippines three weeks before our long-scheduled hearing mission was set to take place. For a second after that tragedy, we paused to consider how to help, and we decided that the best thing we could do was go, as planned, to give the gift of hearing. Joined by boxing champion Manny Pacquiao, fresh from his victory in China, and singer Jessica Sanchez, we brought our love and care to more than 5,000 people in need.</p>\n\n<p>&nbsp; Excited to be as hands-on as possible with the patients, Sanchez worked and traveled with the team for the entire hearing mission. Her first day on the job she helped reconnect 88-year-old Maria Solis Sogon with her 12 children, 20 grandchildren and 5 great-grandchildren. Overwhelmed with gratitude, Maria broke into song to Sanchezâ€™s delight. By the end of the hearing mission, it was Sanchez who was moved to song by all of the incredible people and lives she was able to help change. She performed for a captivated audience, giving many of them their first experience of music.</p>\n\n<p>&nbsp; From General Santos to Lipa City to Batangas to Manila, the team was inspired by the resilience of the Philippines. While many may have been knocked down by the impact of Typhoon Haiyan, from what we experienced, their spirit has not been broken. It will not take long for the Philippines to be just as strong, if not stronger than it was before.</p>\n\n<p>&nbsp; </p>\n\n<p>&nbsp; <b>Happy Holidays!</b></p>\n\n<p>&nbsp; With the holidays upon us, the team is busy preparing for another year of changing lives, while also spending some quality time with the people we love. From the Starkey Hearing Foundation family to yours, we wish you all love, light and peace this holiday season. Thank you for all you do to support our efforts around the world. May 2014 bring you inspiration and adventure!</p>\n\n<p>&nbsp; As you spend time with your friends and families this holiday season, remember the connecting power of hearing.</p>\n\n<p>&nbsp; </p>\n\n<p>&nbsp; <a href=\"https://action.starkeyhearingfoundation.org/\" title=\"\">Pledge your support</a> today and help us give that same connection to thousands of families around the world in 2014.</p>','none','SHF Team','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','','none','','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(14,1,5,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'false','none','{filedir_1}BLOG-Dave_Fabry_Lives_to_Listen_Carefully.jpg','none','Listen Carefully','none',1388215620,'','none','<p>Dave Fabry, Ph.D. audiologist and Starkey Hearing Technologies&rsquo; Vice President of Audiology and Professional Services, has dedicated his life to hearing care. As a young man in college he was a pre-veterinary medicine major, and his love of animals led him to a hearing lab where scientists were studying the damage from noise exposure in chinchillas. There he found his calling. Since then Fabry has earned a doctorate in audiology from the University of Minnesota, published more than 50 articles and been a leader in the field for more than 30 years. However, he has never let go of his interest in noise exposure and raising awareness on how to prevent hearing loss. He has channeled this passion into our Listen Carefully campaign, and we sat down with him to gain a deeper understanding of the challenges and solutions surrounding preventable hearing loss.<br />\n<br />\n<br />\n<strong>How important is hearing protection?</strong><br />\nHearing protection is critical for all age groups. Look at the history of OSHA and hearing protection in the workplace &ndash; we have done a very good job with occupational noise exposure in the workplace. However, recreational noise exposure has become an increasing problem for both adults and children, which could include anything from concerts to loud restaurants and bars to firearms.</p>\n\n<p>We don&rsquo;t often think of children as being at risk for noise exposure, but in fact, it is a huge concern and an emerging problem in the United States with upwards of 20 percent of teens estimated to suffer from measurable hearing loss. We have to do better at protecting kids from preventable hearing loss.<br />\n<br />\n<br />\n<strong>Most of us have been told to wear hearing protection at concerts or to turn down the volume on our headphones to protect our hearing, but what are some of the lesser-known areas where hearing protection should be used?</strong>When looking at dangerous levels of noise exposure, it is all about the intensity of the sound and the duration of exposure. Any sound that is in excess of 85 dB, with extended exposure, will harm your hearing.</p>\n\n<p>There are some really strange places that we don&rsquo;t often think of where dangerous levels of noise exposure can occur. Dentists, for example, are at high risk for noise exposure, due to the sound of the high-frequency drills they use daily. Likewise, the barista at your local coffee shop is at risk for noise exposure due to the sound of the grinder and the high-frequency sound of many cappuccino machines.</p>\n\n<p>In terms of teenagers, one of the places we don&rsquo;t often think of is the school band. The students playing in those bands could be at risk for noise exposure, particularly percussionists and piccolo players and those positioned near them. Violinists are also at a high risk for hearing loss because as they play they place their ears directly against the instrument.</p>\n\n<p>It is important for all of us to take active measures to protect against preventable hearing loss. In my own life I use noise-cancelling headphones on airplanes when I travel to protect against the sounds produced during take off and landing. I also use musicians earplugs when I go to concerts to reduce the sound across the entire frequency spectrum without impacting the sound of the music. I wear those same earplugs when I ride my motorcycle so I can adequately hear other motorists around me while also protecting my hearing. In addition, whenever I mow the grass, I wear hearing protection.<br />\n<br />\n<br />\n<strong>What are the key issues surrounding noise exposure and iPods and MP3 players?</strong></p>\n\n<p>A popular test of the volume of an iPod or MP3 player is that you should never allow the volume to go over half or two-thirds the maximum. Unfortunately, this is an oversimplification because with today&rsquo;s technology it is actually the headphones that determine the output level. I don&rsquo;t want parents and teens to be lulled into a false sense of security by keeping an iPod at or below half the maximum &ndash; that could still be a level that is damaging.</p>\n\n<p>In addition, years ago, we used to recommend that if someone could stand three feet away from you and sing along with the song you are listening to, the music is too loud. But again, due to the level of technology available for headphones, this also no longer applies.</p>\n\n<p>In an ideal world, we could measure on a simulated ear the level that someone listens to an iPod, and then set the limit, but this is not practical for real-world environments. I would encourage parents to listen to the iPod through your child&rsquo;s headphones, and then set the volume at a level that is comfortable for them and not uncomfortably loud. You can also download sound level meter apps that are pretty accurate. You can then hold your child&rsquo;s headphones up to the sound meter app to get an idea of the sound level and set the volume accordingly.</p>\n\n<p>[gallery id=\"listen-carefully-gallery\"]<br />\n<br />\n<br />\n<strong>How do you encourage your loved ones to protect their hearing?</strong></p>\n\n<p>I am very particular with the level my daughter listens to music both in the car and on headphones. I always carry hearing protection with me when I go to concerts, so either my wife or my daughter will be encouraged to wear it when they are with me. I have always tried to stress the importance of protecting their hearing against recreational noise exposure.</p>','none','','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','','none','','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(32,1,12,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,' ','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(33,1,12,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,' ','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(34,1,12,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,' ','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(35,1,12,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,' ','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(36,1,12,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,' ','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(15,1,5,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'true','none','{filedir_1}Blog_A_Knight.jpg','none','Hearing Missions','none',1382632260,'','none','<p><strong>A Knight and a Prince Help Kick Off Fall Missions</strong></p>\n\n<p>&nbsp; Striving for a strong finish to a record-breaking year, the mission team began its fall by spending October giving the gift of hearing in <a href=\"http://www.starkeyhearingfoundation.org/missions/africa/south-africa-10-2013/\" title=\"\">South Africa</a>, <a href=\"http://www.starkeyhearingfoundation.org/missions/africa/lesotho-10-2013/\" title=\"\">Lesotho</a> and Kenya.</p>\n\n<p>&nbsp; The team started out in South Africa where partnered with Sir Richard Branson and <a href=\"http://www.virgin.com/unite\" title=\"\">Virgin Unite</a> for the third time to bring the gift of hearing to hundreds of people in need at Virgin Unite&rsquo;s Bhubezi Healthcare Clinic.</p>\n\n<p>&nbsp; Next, we headed to Lesotho. It was our first hearing mission in the country where we had another wonderful partner in <a href=\"http://sentebale.org/\" title=\"\">Sentebale</a>, a nonprofit organization co-founded by Prince Harry and Prince Seeiso of Lesotho, who participated in the fittings. Patients, ranging from 4 to 101 years old, traveled from all parts of the small, landlocked country to have their hearing assessed and be fitted for hearing aids. For many it was an opportunity to hear for the very first time.</p>\n\n<p>&nbsp; After being honored at the 13th Annual Starkey Hearing Foundation&rsquo;s <em>So the World May Hear Awards</em>Gala in July, Branson joined us to bring the gift of hearing to Virgin Unite&rsquo;s Bhubezi Healthcare Clinic. More than 300 patients from the surrounding Bushbruckridge community were fit with hearing aids. Branson and the Virgin Unite team worked closely with us to ensure each patient left the mission with a new connection to sound and life.</p>\n\n<p>&nbsp; Discussing his continued dedication to the work of the Foundation, Branson said, &ldquo;I admire the Starkey Hearing Foundation for its tireless effort to transform lives with the gift of hearing. I hope it will inspire others, businesses and nonprofits alike, to seek new, innovative and entrepreneurial ways of making a difference in people&rsquo;s lives.&rdquo;</p>\n\n<p>&nbsp; Once the team wrapped up a successful mission in South Africa, we headed to our first mission in Lesotho with new partner <a href=\"http://sentebale.com\">Sentebale</a>.</p>\n\n<p>&nbsp; Prince Seeiso joined the team to help fit hearing aids and open up the world of sound to many living in silence and isolation. &ldquo;I have seen children wanting to talk to each other, and their eyes tell a thousand stories,&rdquo; Prince Seeiso said. &ldquo;On behalf of myself, Prince Harry and Sentebale, a big thanks goes to Starkey Hearing Foundation.&rdquo;</p>\n\n<p>&nbsp; The team is currently in Kenya, where we have traveled from Mombasa to Eldoret to one of the largest slums in Africa, Kibera, to Meru, all the while reflecting caring and connecting communities with the gift of hearing.</p>\n\n<p>&nbsp; <strong>2013 Gala Highlights</strong></p>\n\n<p>&nbsp; Whether it was the bald eagle soaring over the crowd as Nita Whitaker sang &ldquo;AmazingGrace,&rdquo; impassioned speeches from twin brothers Ashton and Michael Kutcher, or special surprise guests for Bill Austin, the 2013 <em>So the World May Hear</em> Awards Gala was an evening we will never forget. Our latest film brings you all the highlights and magic from this year&rsquo;s Gala.</p>\n\n<p>&nbsp; <a href=\"http://youtu.be/KD8h8zNpd48\" title=\"\">Watch as the world comes together to celebrate the power of caring.</a></p>\n\n<p>&nbsp; <strong>Listen Carefully with Tony Hawk and the Minnesota Vikings</strong></p>\n\n<p><span style=\"line-height:1.6em\">&nbsp; October is National Protect Your Hearing Month, and we&rsquo;ve been encouraging people toturn down the volume and Listen Carefully with Chris and Kyle Massey at skateboarding legend Tony Hawk&rsquo;s 2013 </span><a href=\"http://standupforskateparks.org/\" style=\"line-height: 1.6em;\" title=\"\">Stand Up for Skateparks</a><span style=\"line-height:1.6em\"> and with the help of the </span><a href=\"http://www.starkeyhearingfoundation.org/vikings/\" style=\"line-height: 1.6em;\" title=\"\">Minnesota Vikings</a><span style=\"line-height:1.6em\">.</span></p>\n\n<p>&nbsp; Remember: Your hearing is fragile. So don&rsquo;t listen loudly. Listen Carefully.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; Chris and Kyle Massey joined our team as we spread the word about the importance of protecting your hearing at the 2013 Stand Up for Skateparks, and we were encouraged to see the message stick as much of the audience wore the hearing protection we distributed during a headlining performance by Modest Mouse.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; The Minnesota Vikings have teamed up with our Listen Carefully campaign to encourage fans to protect their hearing, and they are donating $500 to the Foundation for every touchdown scored this season by Adrian Peterson or Greg Jennings. Vikings fans should also be on the look out for Listen Carefully hearing protection at all home games.</p>','none','SHF Team','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','',NULL,'','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(16,1,6,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'Hearing Missions','none','','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'','xhtml','','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(17,1,10,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'<p>&#8203;testing</p>','none','','xhtml','','xhtml','','xhtml','',NULL,NULL,NULL,'',NULL,'','xhtml','','none','','none','','none','','none',' ','xhtml',' ','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(18,1,11,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','{filedir_1}CAROUSEL-Building_a_Better_Kibera.jpg','none','','none','','none',1388468400,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(19,1,10,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'<p>Our global work developing sustainable systems of hearing care gives us a unique window into the many challenges facing people around the world. Hearing is our vehicle to change lives, but we know we can only do so much alone. In order to create real change, we must harness the power of many and develop a holistic approach to address the multitude of pressing global challenges.</p>\n\n<p>It empowers individuals to discover their passions and channel them in ways that will improve their communities and ultimately, the world. Through Operation Change we are providing the inspiration to drive engagement and develop a roadmap to create collective impact. This multimedia campaign incorporates a documentary series, a web platform and social media to encourage individual philanthropy and tap into the energy of a generation.</p>\n\n<p>We believe that the actions of a single person can create a ripple effect that will ignite a movement and change the world.</p>\n\n<p>[gallery id=\"operation-change-intro-video\"]</p>','none','<h1>Listen Carefully</h1>\n\n<p>Research shows that 1 in 8 children and teens in the United States has hearing loss, largely due to high-volume sounds in daily life. Most hearing loss among teens can be avoided if simple protective measures&ndash;such as lowering the volume&ndash;are taken.</p>\n\n<p>The program combines music and education to raise awareness about the fragility of hearing and the dangers of exposure to high decibel sounds.&nbsp;This year Starkey Hearing Foundation expanded Listen Carefully to offer educational support to more than 16,000 teachers and nearly 500,000 students nationwide.</p>\n\n<p>[gallery id=\"listen-carefully-10-second-film\"]</p>\n\n<h1>&nbsp;</h1>\n\n<h1>Make a Difference&nbsp;</h1>\n\n<p>Start with yourself. Your family. Your friends. Because you understand the transformative, interconnecting power of hearing. 1 in 5 Americans has hearing loss-meaning we&rsquo;re losing our hearing faster, today, than our parents or grandparents did.</p>\n\n<p>[gallery id=\"listencarefully2\"]</p>\n\n<p>&nbsp;</p>\n\n<h1>Educate Yourself&nbsp;</h1>\n\n<p>Loud sounds are often part of daily life. Repeat or elongated exposure to high-volume sounds&ndash;such as music pumped through headphones&ndash;harms hearing over time.</p>\n\n<p>Your ears are complex organs, but protecting them is relatively simple. Use these resources to increase your awareness. And share what you know.</p>\n\n<p>[gallery id=\"listencarefully3\"]</p>','none','<p>Starkey Hearing Foundation has provided more hearing help to people in the United States than to any other country. We do this through domestic missions and also Hear Now, our application-based program that provides hearing help to low-income Americans. Hear Now is committed to assisting U.S. residents with hearing loss, who have no resources to acquire hearing aids. Starkey Hearing Foundation provides the hearing aids and runs the program, but we count on the generosity of Hear Now providers and donors across the country to ensure its success.&nbsp;Each person we help is fit with new, top-of-the-line digital hearing aids that are customized to their hearing loss.&nbsp;</p>\n\n<p>If you or someone you know is struggling with hearing loss and unable to afford hearing aids, call 1-800-328-8602 or complete the form below, and a Hear Now representative will be in touch with you.&nbsp;</p>\n\n<p>[gallery id=\"hearnow\"]</p>','none','<p>Every year thousands of hearing aids are donated to our Hear Now program from hearing professionals and other people looking to help. Those hearing aids open up the world of sound to someone in need. Many of the hearing aids used on international missions come from the recycling program, making hearing aid donations vital to the success of the Foundation. However, the journey from donation to the mission field is an absolute labor of love.&nbsp;</p>\n\n<p>[gallery id=\"hearingaidrecycling\"]</p>\n\n<p>Send us your old hearing aids, to give the gift of hearing to those in need and contribute to a healthy environment. Any make or model, regardless of age, can be donated. All donations are tax deductible* and a letter of acknowledgment will be sent to all donors.<br />\n&nbsp;</p>\n\n<h2><strong>Ready to contribute your hearing devices? Follow these simple steps to send them in:</strong></h2>\n\n<p>1. Place the hearing aid in a crush-proof box, old pill bottle, or other securepackage.</p>\n\n<p>2. Register and insure the package, if possible, to ensure that receipt of your donated device</p>\n\n<p>3. Mail to:<br />\nStarkey Hearing Foundation<br />\nATTN: Hearing Aid Recycling<br />\n6700 Washington Avenue South<br />\nEden Prairie, MN 55344<br />\n<br />\n<strong>For more information, contact us at:</strong><br />\nhearnow@starkeyfoundation.org<br />\n(866) 354-3254</p>\n\n<hr />\n<p><small>*Please note: Due to the diversity in age, make, and condition of the aids we receive, it is not possible for us to determine a tax-deductible value for each aid.<br />\nPlease consult your tax advisor.</small></p>','none','',NULL,NULL,NULL,'',NULL,'<p>Starkey Hearing Foundation&rsquo;s commitment to global hearing health begins right here at home.&nbsp;Along with our worldwide missions, our national programs contribute to an entire system of care.&nbsp;Everyone can make a difference in the lives of those across the world or just next-door. Together, we can create a movement that brings peace and understanding through the gift of hearing.</p>','none','programs@starkeyfoundation.org','none','If you have already spoken with a representative and need an application, you can download one here:','none','{filedir_2}FORM7970-10-EE-XX-Hear-Now-Application-2014.pdf','none','{filedir_2}FORM7970-10-EE-XX-Hear-Now-Application-2014_SPANISH.pdf','none',' ','xhtml',' ','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(20,1,1,'We provide more hearing help to people in the United States than to any other country','none','{filedir_1}HERO-Vikings_Mission-IMG_6312.jpg','none','http://www.starkeyhearingfoundation.org/programs/hear-now/','none','',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'Learn More ','none','',NULL,'','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(21,1,5,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'false','none','{filedir_1}September_Newsletter.jpg','none','News','none',1378791720,'','none','<p>Special Olympics Athletes Receive the Gift of Hearing</p>\n\n<p>After the team returned from fitting more than 10,000 people in&nbsp;Peru&nbsp;and&nbsp;Mexico, our campus was flooded with inspiration when 22 Special Olympics Minnesota athletes and their families arrived for a homegrown mission. The Foundation has partnered with Special Olympics Minnesota on its Healthy Hearing Athletes Initiative, and this mission kicked off what we hope will become a long and life-changing collaboration that will open up the world of sound to all Special Olympics athletes in need. Each athlete was fit with top-of-the-line, customized hearing aids that opened up the world of sound like never before.</p>\n\n<p>Discussing the significance of this mission, Bill Austin said, &ldquo;We don&rsquo;t believe in disabilities. We believe in ability. Everybody has it, and we have to find it and use it and maximize it.&rdquo;</p>\n\n<p>Former Minnesota Viking Matt Blair was also on hand to support the athletes, including his good friend Katie Timmer. She has been participating in Special Olympics for more than 30 years and met Blair at a golf tournament. Over the years, Blair has become Timmer&rsquo;s biggest fan. Unfortunately, She suffered from a hearing loss that had begun to affect her performance, but once she received the gift of hearing, she couldn&rsquo;t wait to get back out on the golf course.</p>\n\n<p>Special Olympics president, Dave Dorn, said the partnership with the Foundation would make a huge difference in each of the athlete&rsquo;s lives.</p>\n\n<p>&ldquo;It&rsquo;s a&nbsp;confidence&nbsp;builder,&rdquo; Dorn said. &ldquo;They can be engaged in conversations and hear the world around them. All of a sudden they are much more participatory and active in their surroundings because they can hear what&rsquo;s going on.&rdquo;</p>\n\n<p>The mission team is currently on its way to South Africa which will be followed by missions in Lesotho and Kenya.</p>\n\n<p>The Power of Partnerships</p>\n\n<p>President Bill Clinton and Chelsea Clinton once again joined the team on a recent mission swing through in Zambia, Tanzania and Rwanda to see our 1 million hearing aid commitment in action. Our latest film showcases the power of partnerships in providing the gift of hearing and tackling some of the world&rsquo;s most challenging issues.</p>\n\n<p>Watch as powerful organizations come together to create lasting change.</p>\n\n<p>Join us for a Hearing Protection Twitter Chat!</p>\n\n<p>October is National Protect Your Hearing Month! Research shows that 1 in 5 teens in the United States has hearing loss, largely due to high-volume sounds in daily life, such as music streamed loudly into headphones. Most hearing loss among teens can be avoided if simple protective measures &ndash; such as lowering the volume &ndash; are taken.</p>\n\n<p>Your hearing is fragile. So don&rsquo;t listen loudly. Listen Carefully.</p>\n\n<p>Join us on Twitter Thursday, October 3, from 12-1 p.m. CDT as Starkey Hearing Foundation and Starkey Hearing Technologies discuss ways to protect your hearing and prevent hearing loss!</p>\n\n<p>If you&rsquo;re new to Twitter chats,&nbsp;here&rsquo;s an overview of how it works&hellip;</p>\n\n<p>Commit Today</p>\n\n<p>Pledge your support today&nbsp;and help us change a life during our upcoming missions in South Africa or Lesotho.</p>','none','SHF Team','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','',NULL,'',NULL,'','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(22,1,7,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}CAROUSEL-Peru_Mission-02-DSC07062.jpg','none','Experience More','none','Gift of Hearing in Peru ','none','{filedir_1}CAROUSEL-Peru_Mission-02-DSC07062.jpg','none','','none','','none','','none','<p>Organizing a five city, nearly 20,000 hearing aid mission in Peru is no small feat! With the help of more than 70 Rotary clubs from across Peru and Minnesota, the mission team led the charge for this unprecedented 21-day mission to change thousands of lives.</p>','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'','none','','none','','none','','none','','xhtml','','xhtml','','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(48,1,6,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'Where We were Yesterday','none','{filedir_1}icon_stories.png','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(31,1,12,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,' ','xhtml','','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(23,1,5,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'true','none','{filedir_1}PeaceinWestBank.jpg','none','News','none',1381950660,'','none','<p>Starkey Hearing Foundation&nbsp;is excited to be heading back to the West Bank soon for an upcoming hearing mission. Our work in the region has shown us how hearing brings people together and serves as a vehicle for peace and understanding.</p>\n\n<p>We wanted to share some feedback from a recent mission as we currently prepare for the next one.</p>\n\n<p>&ldquo;Before the mission &ndash; my first &ndash; I was so excited and really didn&rsquo;t know what to expect. Now I can definitely&nbsp;say it was not like anything I had done before. I have lived in this conflict all my life, and today, for the first time I met my neighbors who greeted me with nothing but love. I was amazed to see all the happy faces and know that my small efforts could give someone so much joy. I hope that this mission will take us one step closer to peace, and I hope it won&rsquo;t be the last.&rdquo;</p>\n\n<p>- Chen Cohen</p>\n\n<p>Our local partners have been hard at work, completing phase one by identifying patients and taking impressions. We look forward to contributing to peace building by continuing to foster connections between people and across cultures through the gift of hearing. Check out the photos below to see the preparation.</p>\n\n<p><img alt=\"\" src=\"{filedir_1}westbank2.jpeg\" style=\"height:250px; width:333px\" />&nbsp;</p>','none','SHF Team','none','',NULL,'',NULL,'',NULL,'',NULL,