'none','','none','','none','','none'),(41,1,6,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'Gallery','none','{filedir_1}icon_gallery.png','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(42,1,3,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','34.052234','none','-118.243685','none','Los Angeles, CA','none','<p><span style=\"line-height:1.6em\">Chris and Kyle Massey joined our team as we spread the word about the importance of protecting your hearing at Tony Hawk&rsquo;s 2013 Stand Up for Skateparks. W</span><span style=\"line-height:1.6em\">e were encouraged to see the message stick as </span><span style=\"line-height:1.6em\">the audience wore the hearing protection we distributed during a headlining performance by Modest Mouse.</span></p>','none','',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'http://www.starkeyhearingfoundation.org/programs/listen-carefully/ ','none','Learn More ','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}MAP-Los-Angeles-Listen-Carefully.jpg','none',NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none','','none'),(51,1,5,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'false','none','{filedir_1}PoweringInspiration_.jpg','none','Hearing Missions','none',1378758960,'','none','<h2>Katie Timmer is a multi-talented fireball of energy who has been inspiring others with her athletic ability through Special Olympics for more than 30 years.</h2>\n\n<p><span style=\"line-height:1.6em\">Her aptitude&nbsp;for sports has led her to swimming, golf, bocce ball, track and field and bowling, and it has also garnered the attention of sports stars like Tiger Woods and Matt Blair. Her mother and coach Pat expressed great pride in her daughter saying, &ldquo;The minimum&nbsp;age for participating in the Special Olympics is eight, and Katie just counted down the days until her eighth birthday when she could become a part of this incredible organization.&rdquo;</span></p>\n\n<p>However, Katie&rsquo;s path to success has not been without some extraordinary challenges caused by hearing loss. Due to Katie&rsquo;s high pain tolerance, as a child she suffered many ear infections that went undetected. In addition, her love of swimming created issues with swimmer&rsquo;s ear and a recurring need for tubes in her ears. After several surgeries, Katie and her family had resigned themselves to the fact that her right ear could be treated with a hearing aid, but she would never hear out of her left ear again. Katie learned to adapt, but her mother always felt that if she could only have the use of both of her ears, she wouldn&rsquo;t have to struggle so much to excel.</p>\n\n<p><span style=\"line-height:1.6em\">At our recent Special Olympics mission in Eden Prairie, Minnesota, Bill Austin gave Katie the gift of hearing in BOTH of her ears. Shocked and overjoyed, Katie and her mother expressed their amazement and gratitude&nbsp;in a recent video. Check it out!</span></p>','none','SHF Team ','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none','','none','','none','','none',0,'','none','','none','','none','','none','','none','','none','','none','','none',''