,NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'true','none','{filedir_1}BillandTani.jpg','none','','none','{filedir_1}Clinton_Foundation_Logo.png','none',1391388900,'','none','Today, as part of a 10-day trip across five African nations, President Bill Clinton and Chelsea Clinton joined the Starkey Hearing Foundation in Livinstone, Zambia, to help fit children for hearing aids. ','none','Read More ','none','http://www.clintonfoundation.org/blog/2013/08/02/starkey-executive-director-speaks-miracle-watching-patients-hear-very-first-time','none','Clinton Foundation ','none','false','none','','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL),(57,1,11,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'true','none','{filedir_1}CAROUSEL-Providing_Clean_Water_in_Tanzania.jpg','none','http://www.youtube.com/watch?v=OJ4W9zzjgII','none','{filedir_1}cnnlogo.png','none',1391475420,'','none','','none','','none','','none','','none','','none','','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL),(59,1,3,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','44.881702','none','-93.400947','none','Eden Prairie, MN','none','<p>Traveling from nearby Metro Deaf School and Faribault School for the Deaf and from as far away as California, Missouri and Indiana, more than 50 patients arrived at Starkey Hearing Foundation headquarters for a joint hearing mission with the Minnesota Vikings.&nbsp;Overjoyed to meet their heroes, the children taught Vikings superstars, including&nbsp;Adrian Peterson and&nbsp;Greg Jennings, some sign language.</p>','none','',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none','Learn More ','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}MAP-Vikings_Mission-IMG_6064.JPG','none',NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL),(60,1,3,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','-5.185310','none','-80.649003','none','Peru','none','<p>Organizing a five city, nearly 20,000 hearing aid mission in Peru is no small feat! With the help of more than 70 Rotary clubs from across Peru and Minnesota, the mission team led the charge for this unprecedented 21-day mission to change thousands of lives.</p>','none','',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none','Learn More ','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}MAP-Peru_Mission-02-DSC07062.jpg','none',NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL),(61,1,3,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','-26.333806','none','28.390688','none','Bhubezi, South Africa','none','<p>Our Founder Bill Austin says, \"Alone we can&#39;t do much. Together we can change the world.\" We believe that by working together and building strong partnerships, we can make an even greater impact. In October 2013, we once again partnered with Sir Richard Branson and our friends at Virgin Unite to change lives at their Bhubezi Health Care Clinic in South Africa.</p>','none','',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'http://www.youtube.com/watch?v=VJqzdck05iA','none','Watch Now','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}MAP-Changing_Lives_with_Sir_Richard_Branson_and_Virgin_Unite.jpg','none',NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL),(62,1,3,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','31.952162','none','35.233154','none','West Bank','none','<p>Starkey Hearing Foundation&nbsp;is excited to be heading back to the West Bank soon for an upcoming hearing mission. Our work in the region has shown us how hearing brings people together and serves as a vehicle for peace and understanding.</p>','none','',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'http://www.youtube.com/watch?v=UakFpSGn_AA&feature=c4-overview-vl&list=PLc9R442DNsrtj12vqxhT5kbVDBSDNLpqm','none','Watch Now','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none',NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL),(63,1,3,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','-1.292066','none','36.821946','none','Nairobi, Kenya','none','<p>Shining Hope for Communities guided us through the narrow streets of Kibera, the largest urban slum in Africa, we found enormous inspiration in the ability of the human spirit to triumph over adversity. The Clinton Global Initiative has inspired us to make a new commitment to use the power of our network and resources to mobilize partnerships and create a sustainable impact in Kibera.</p>','none','',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'