ing over the crowd as Nita Whitaker sang &ldquo;Amazing Grace,&rdquo; impassioned speeches from twin brothers Ashton and Michael Kutcher, or special surprise guests for Bill Austin, the 2013 So the World May Hear Awards Gala was an evening we will never forget. Our latest film brings you all the highlights and magic from this year&rsquo;s Gala.</p>','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL),(66,1,11,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'false','none','{filedir_1}BillandTani.jpg','none','','none','','none',1386703320,'','none','','none','Read More ','none','','none','CNN ','none','true','none','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent nec hendrerit est, at tempus nisi. Donec sed urna id odio molestie gravida. Nullam quis tellus ipsum. In feugiat varius iaculis. Phasellus facilisis varius pellentesque. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum eget placerat est. Interdum et malesuada fames ac ante ipsum primis in faucibus. Nullam volutpat venenatis lectus et sollicitudin. Donec felis purus, sodales a lacinia vel, convallis eu felis. Proin cursus sit amet velit vel luctus. Nam vitae orci vitae felis ornare malesuada in in tortor. Suspendisse lobortis magna eros, sed interdum arcu commodo porttitor. Nullam lorem ipsum, euismod quis lorem et, tincidunt pulvinar libero. Etiam rutrum venenatis ultrices.</p>\n\n<p>Nullam adipiscing metus a lacus consequat, nec ultrices augue pharetra. Nunc in dic