ission will hold dear to their hearts for the rest of their lives.</p>\n\n<p>[<span class=\"GRcorrect\" grcontextid=\"gallery:0\" grmarkguid=\"0c25a44e-09e6-4426-a935-6706bd07e6ca\" gruiphraseguid=\"05a6ba73-07bc-4d38-87e9-2fb582df3955\">gallery</span> id = \"transforming-through-<span class=\"GRcorrect GRnoSuggestion\" grcontextid=\"volunteerism:1\" grmarkguid=\"6e1f9f86-a28f-443c-8341-282e234494b6\" gruiphraseguid=\"05a6ba73-07bc-4d38-87e9-2fb582df3955\">volunteerism</span>-in-<span class=\"GRcorrect\" grcontextid=\"queretaro:2\" grmarkguid=\"08cff9a5-f054-48cf-9ddf-e6a8976bdb04\" gruiphraseguid=\"05a6ba73-07bc-4d38-87e9-2fb582df3955\">queretaro</span>\"]</p>','none','SHF Staff','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL),(70,1,13,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}CAROUSEL-2013_STWMH_Awards_Gala_Highlights.jpg','none','SHF Team ','none','<h3 style=\"color:#aaa; font-style:italic\">Foundation ahead of schedule to fit one million hearing aids this decade</h3>\n\n<p>MINNEAPOLIS (February 19, 2013) &ndash; The Starkey Hearing Foundation expanded its efforts to record levels in 2012. Fitting more than 131,000 hearing aids to people in need, the foundation surpassed its Clinton Global Initiative commitment of fitting 100,000 hearing aids annually. At this rate, it is 25 percent ahead of schedule for fitting one million people this decade.</p>\n\n<p>Hearing missions are the primary way Starkey Hearing Foundation realizes its goal:&nbsp;So the World May Hear. This past year, the foundation&rsquo;s team of audiologists and staff conducted international and domestic hearing missions in 65 cities across 25 countries. The foundation changed lives with the gift of hearing in nine new countries in 2012, including Ethiopia, Lebanon, Malaysia, Papua New Guinea, China, Senegal, Ghana, Nigeria and Liberia &mdash; expanding its reach to more than 100 countries.</p>\n\n<p>Most recently, the team fit more than 100 people, including nearly 50 children, with customized, free hearing devices at two missions in New Orleans on February 1 and 2, leading up to the professional football championship game. Starkey was joined by celebrity and professional athlete volunteers, including country music superstar Garth Brooks, American Idol winner Jordin Sparks and NFL players Craig Stevens of the Tennessee Titans, Greg Jennings from the Green Bay Packers, Kyle Rudolph from the Minnesota Vikings and Brian de la Puente from the New Orleans Saints.</p>\n\n<p>&ldquo;The Starkey Hearing Foundation has done a tremendous job impacting lives, and as an athlete and role model, I try to do the same,&rdquo; said Jennings. &ldquo;Starkey is one of the best charities I know that is trying to impact lives on a daily basis, not just once or twice a year.&rdquo;</p>\n\n<p>Celebrity and professional athlete volunteers commonly assist at the foundation&rsquo;s missions where they witness the life-changing impact of this cause and support recipients as they are fitted with their new hearing aids, receive audio testing, counseling and instruction on how to care for their new devices, all courtesy of Starkey Hearing Foundation.</p>\n\n<p>Says Sparks, who also attended a mission in Rwanda in 2011, &ldquo;It was a lot of hard work, but it was really rewarding. It&rsquo;s amazing to see the foundation&rsquo;s reach is so much further than just here in the United States.&rdquo; Sparks hopes to attend another mission in the future and says, &ldquo;I&rsquo;ll always be a fan of the Starkey Foundation.&rdquo;</p>\n\n<p>The Starkey Hearing Foundation looks forward to making an even bigger impact in 2013. Missions are being planned for Mexico, Haiti, South Africa, Tanzania, Cambodia, Papua New Guinea, India, Ethiopia, Malaysia, China, Uganda, Rwanda and the Philippines.</p>\n\n<p>The foundation changes lives through more than just missions. This past year it launched the&nbsp;Listen Carefully&nbsp;teaching guide to nearly 500,000 students to educate them about hearing protection and care. The foundation also provided more than 8,500 digital hearing aids to Americans in need through&nbsp;Hear Now, a domestic program to help those in need, and recycled more than 45,000 used hearing aids.</p>\n\n<p>The foundation&rsquo;s largest fundraiser, The&nbsp;So the World May Hear&nbsp;Awards Gala, also set a new record in 2012, raising more than $7.6 million to support its work around the world.</p>\n\n<p>&ldquo;The team is excited for the new opportunities and adventures 2013 will bring,&rdquo; said Bill Austin, founder of Starkey Hearing Foundation. &ldquo;We are passionate about making a difference in people&rsquo;s lives here and around the world by showing them that we care. Watching somebody light up as they hear for the first time is an incredible experience, and sharing that moment is something you never forget.&rdquo;</p>\n\n<p>According to Starkey Hearing Foundation, hearing loss is pervasive, affecting 34 million Americans &mdash; about one in ten. Yet, with the help of a hearing device, hearing loss can often be corrected, giving an individual the opportunity to better connect with their family, the community and the world around them.</p>\n\n<p>More information about the foundation&rsquo;s work can be found at Starkey Hearing Foundation&rsquo;s&nbsp;website, as well as via Starkey Hearing Foundation&rsquo;s&nbsp;Facebook&nbsp;and&nbsp;Twitter&nbsp;pages.</p>\n\n<p>About Starkey Hearing Foundation</p>\n\n<p>Starkey Hearing Foundation uses hearing as a vehicle to reflect caring and improve the lives of individuals, families and communities around the world, by helping them reach their full potential. Hearing loss affects one in 10 Americans, and 63 million children worldwide, yet many do not have access to the hearing devices that can help them. Starkey Hearing Foundation fits and gives more than 100,000 hearing aids annually, and as a member of President Clinton&rsquo;s Global Initiative, it has pledged to fit one million hearing aids this decade. In addition to giving the gift of hearing through worldwide hearing missions, Starkey Hearing Foundation promotes hearing health awareness and education through the Listen Carefully initiative and provides hearing instruments to low-income Americans through the Hear Now program. For more information on Starkey Hearing Foundation, visit www.starkeyhearingfoundation.org.</p>','none','{filedir_2}SHF_2012Overview_NewsRelease_FINAL1.docx','none','pr@starkeyhearingfoundation.org','none'),(75,1,13,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'{filedir_1}CAROUSEL-Building_a_Better_Kibera.jpg','none','','none','<p>Foundation pledges hearing help to people affected by the Boston Marathon attack</p>\n\n<p>&nbsp;Minneapolis (April 18, 2013) &ndash; In response to the Boston Marathon tragedy, Starkey Hearing Foundation is offering free assistance to those who may have suffered hearing loss or tinnitus (residual ringing in the ears) as a result of the explosion.</p>\n\n<p>The Foundation believes this is a time when many should come together to extend caring hands, and people joining together to reflect light will outshine these moments of darkness. Starkey Hearing Foundation has helped people in need for more than 30 years and is hoping that by providing hearing assistance, it can play a small role in the recovery efforts in Boston.</p>\n\n<p>Individuals that think they may need hearing help should contact Starkey Hearing Foundation. The Foundation will work with local partners in the greater Boston area to make sure they receive hearing testing and care and will also provide hearing aids to the people that need them.</p>\n\n<p>For assistance, please contact:</p>\n\n<p>Starkey Hearing Foundation</p>\n\n<p>866.354.3254</p>','none','{filedir_2}SHF_2012Overview_NewsRelease_FINAL1.docx','none','info@starkeyfoundation.org','none'),(71,1,11,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','none','{filedir_1}DSC08418cc_edit.jpg','none','','none','','none',1383338880,'','none','','none','','none','','none','SHF Team ','none','true','none','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent nec hendrerit est, at tempus nisi. Donec sed urna id odio molestie gravida. Nullam quis tellus ipsum. In feugiat varius iaculis. Phasellus facilisis varius pellentesque. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum eget placerat est. Interdum et malesuada fames ac ante ipsum primis in faucibus. Nullam volutpat venenatis lectus et sollicitudin. Donec felis purus, sodales a lacinia vel, convallis eu feli