earing Missions','none',1362507480,'','none','<p>Like a typical 9-year-old girl, Maci Rowan loves the band One Direction and will proudly proclaim to anyone listening that her favorite song is&nbsp;What Makes You Beautiful. However, Maci is anything but typical. Born with cerebral palsy, she has had to overcome some significant physical obstacles in her short life. These obstacles became even more daunting last year when she began to suffer hearing loss.</p>\n\n<p>Despite her hearing loss, Maci continued to seek out ways to connect to the world and outlets for her jubilant energy and desire to learn. Unfortunately, Maci&rsquo;s normally excellent grades began to fall, and her frustration with not doing well in school and inability to connect with her peers and teachers, caused her to act out in class.&nbsp; At home, she turned to her dolls for company and connection. Her mother Christy became increasingly concerned over Maci&rsquo;s retreat into isolation. She recognized that hearing loss was to blame and reached out to Starkey Hearing Foundation for help.</p>\n\n<p>[gallery id = \"an-u\"]</p>\n\n<p>When Maci came to see us in New Orleans, her smile lit up the room, and her laughter was contagious. We had invited Maci to our Friday mission in partnership with Garth Brooks&rsquo; Super ProCamps, so that she could not only receive the gift of hearing but also participate in all the fun activities for the children. We watched in amazement as NFL stars were drawn to her boundless joy and curiosity. The Foundation team and our celebrity volunteers just couldn&rsquo;t get enough of Maci. &nbsp;Explaining her daughter&rsquo;s unique spirit, Christy said with a smile, &ldquo;She has always been this way. Once she gets you wrapped around her finger, you&rsquo;re lost. You have no chance of disciplining her.&rdquo;</p>\n\n<p>By the time she sat in Bill Austin&rsquo;s chair to receive the gift of hearing, Maci had not heard her own voice in months, but once she was fit, she beamed her irrepressible light and cried out, &ldquo;Oh! I can talk again!&rdquo;</p>\n\n<p>Able to confidently connect with the world again, Maci immediately joined the kids participating in the ProCamps cheerleading activities and won the &ldquo;Champion of the Day&rdquo; award. We know that with the gift of hearing this amazing girl will continue winning and inspire many more hearts and minds.</p>','none','SHF Staff','none','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'','xhtml','',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL),(78,1,12,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,' ','xhtml','',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL),(79,1,12,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,' ','xhtml','',NULL,'',NULL,'',NULL,'',NULL,0,NULL,NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL);
